import React, {Component} from 'react';
import './App.css';
import { AgGridReact } from 'ag-grid-react';
import 'ag-grid-community/dist/styles/ag-grid.css';
import 'ag-grid-community/dist/styles/ag-theme-balham.css';


class App extends Component{
  constructor(props) {
        super(props);

        this.state = {
            columnDefs: [
                {headerName: 'Match Id', field: 'matchid'},
                {headerName: 'Match Name', field: 'matchname'},
                {headerName: 'Team1', field: 'team1'},
                {headerName: 'Team2', field: 'team2'},
                {headerName: 'Overs', field: 'overs'},

            ],
            rowData: [
                {matchid: 1, matchname: 'Friendly', team1: 'Unity', team2:'Royal', overs:4},
                {matchid: 2, matchname: 'Friendly', team1: 'Unity', team2:'Shree Ganesh', overs:4},
                {matchid: 3, matchname: 'Friendly', team1: 'Unity', team2:'Sangharsh', overs:4},
            ]
        }
    }
   render(){ 
    return (
      <div className="ag-theme-balham"
            style={{height: '200px', width:'600px'}} >
        <AgGridReact className='fl w-20 pa2'
            enableSorting={true}
            enableFilter={true}
            columnDefs={this.state.columnDefs}
            rowData={this.state.rowData}>
        </AgGridReact>
      </div>
  );
}
}

export default App;
